import React from 'react';
import logo from '../logo.png'; // 로고 이미지의 경로를 정확히 입력하세요.
import '../css/MvsrchPage.css'

function MvsrchPage() {
    return (
      <div className="mvsrchPage">
        <img src={logo} alt="Logo" className="Logo" />
        {/* 페이지 내용 */}
      </div>
    );
  }


